const myImage = new Image();
myImage.src = ' data:image/jpeg;base64,'

myImage.addEventListener('load', function(){
    const canvas = document.getElementById('canvas1');
    const contextCanvas = canvas.getContext('2d'); 
    canvas.width = 780;
    canvas.height = 438;
    contextCanvas.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    const pixels = contextCanvas.getImageData(0, 0, canvas.width, canvas.height);
    contextCanvas.clearRect(0, 0, canvas.width, canvas.height);



    let particlesArray = [];
    const numberOfParticles = 2000;

    let mappedImage = [];
    for (let y = 0; y < canvas.height; y++){
        let row = [];
        for (let x = 0; x < canvas.width; x++){
            const red  = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green  = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue  = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brigthness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brigthness,
                cellColor = 'rgb('+ red +','+ green +','+ blue +')'
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    function calculateRelativeBrightness(red, green, blue){
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        )/100;
        
    }
    class Particle {
        constructor(){
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 3,.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        update(){
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2][0];
            let moviment = (2.5 - this.speed) + this.velocity;
            this.y += moviment;
            if (this.y >= canvas.height){
                this.y = 0;
                this.x = Math.random() * canvas.width;
             
            }
        }
        draw(){
            contextCanvas.beginPath();
            contextCanvas.fillStyle = mappedImage[this.position1][this.position2][1];
            contextCanvas.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            contextCanvas.fill();
        }

    }
    
    function init(){
        for (let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle);
            
        }
    }
    
    init();
    function animate(){
        contextCanvas.globalAlpha = 0.05;
        contextCanvas.fillStyle = 'rgb(0,0,0)';
        contextCanvas.fillRect(0, 0, canvas.width, canvas.height);
        for (let i = 0; i < particlesArray.length; i++){
            particlesArray[i].update();
            contextCanvas.globalAlpha = particlesArray[i].speed * 0.5;
            particlesArray[i].draw();
            
        }
        requestAnimationFrame(animate);
    }
    animate();
});

